import{_ as e,o as i,c as a,d as s}from"./app-DPHaq2hV.js";const l={},t=s('<h1 id="ios-使用" tabindex="-1"><a class="header-anchor" href="#ios-使用"><span>iOS 使用</span></a></h1><p>首先，确保您从App Store安装了“Fileball”（不是“Fireball”）应用。</p><h2 id="开始" tabindex="-1"><a class="header-anchor" href="#开始"><span>开始</span></a></h2><p>现在，打开它，允许权限，您将转到如图界面。轻触底栏从左往右第二个“连接”图标。 <img src="https://i.postimg.cc/zvFjvqXM/20240413160846.png" alt="ios-fileball-files"></p><h2 id="连接" tabindex="-1"><a class="header-anchor" href="#连接"><span>连接</span></a></h2><p>完成上一步后，您应该转到了“连接”页面，如图。 <img src="https://i.postimg.cc/X7xL0NPB/20240413160853.png" alt="ios-fileball-connections"></p><p>在“连接”页面，轻触“添加媒体服务器”选项，转到如图页面。 <img src="https://i.postimg.cc/jSd8Wnfh/20240413160858.png" alt="ios-fileball-addmediaserver"></p><p>轻触“Emby”选项，进入如图页面，填写之前获取的主机名、端口、用户名和密码信息，轻触保存、连接。 <img src="https://i.postimg.cc/25yXtL85/20240413160923.png" alt="ios-fileball-addemby"></p><h2 id="故障排除" tabindex="-1"><a class="header-anchor" href="#故障排除"><span>故障排除</span></a></h2><p>若出现“401 Unauthorized”，请尝试退回到“连接”页面并打开保存的连接、更换服务器地址或打开代理。 <img src="https://i.postimg.cc/63sgG5t5/20240413161826.png" alt="ios-fileball-connections-final"></p><h2 id="享受" tabindex="-1"><a class="header-anchor" href="#享受"><span>享受</span></a></h2><p>在完成上述步骤后，您将转到如图界面，享受您的Emby服务吧！ <img src="https://i.postimg.cc/PJfjPrQv/20240413162348.jpg" alt="ios-fileball-emby"></p>',12),n=[t];function c(p,o){return i(),a("div",null,n)}const h=e(l,[["render",c],["__file","ios.html.vue"]]),d=JSON.parse('{"path":"/guide/use/ios.html","title":"iOS 使用","lang":"en-US","frontmatter":{},"headers":[{"level":2,"title":"开始","slug":"开始","link":"#开始","children":[]},{"level":2,"title":"连接","slug":"连接","link":"#连接","children":[]},{"level":2,"title":"故障排除","slug":"故障排除","link":"#故障排除","children":[]},{"level":2,"title":"享受","slug":"享受","link":"#享受","children":[]}],"filePathRelative":"guide/use/ios.md"}');export{h as comp,d as data};
